INSERT INTO `posts` (`id_article`, `titre`, `contenu`, `date_publication`, `id_user`, `img`) VALUES
(9, 'Lorem Ipsum', 'Le Lorem Ipsum est simplement du faux texte employé dans la composition et la mise en page avant impression. Le Lorem Ipsum est le faux texte standard de l&#039;imprimerie depuis les années 1500, quand un imprimeur anonyme assembla ensemble des morceaux de texte pour réaliser un livre spécimen de polices de texte. Il n&#039;a pas fait que survivre cinq siècles, mais s&#039;est aussi adapté à la bureautique informatique, sans que son contenu n&#039;en soit modifié. Il a été popularisé dans les années 1960 grâce à la vente de feuilles Letraset contenant des passages du Lorem Ipsum, et, plus récemment, par son inclusion dans des applications de mise en page de texte, comme Aldus PageMaker.', '2025-01-21', 1, );
INSERT INTO `posts` (`id_article`, `titre`, `contenu`, `date_publication`, `id_user`, `img`) VALUES
(14, 'Découvrir le quartier de La Croix-Rousse', 'La Croix-Rousse est le quartier bobo de Lyon. Vous y trouverez de nombreuses petites boutiques, des galeries d’art, des restaurants traditionnels, des bars, un grand marché et une atmosphère particulière. Situé sur les hauteurs de Lyon, juste au dessus de la place des Terreaux, ce quartier s’est métamorphosé d’année en année. En effet, la colline de Croix-Rousse fut longtemps habitée par des ouvriers et clairsemée d’usines quand Lyon était la capitale de la soie. Comme dans le vieux Lyon, vous pourrez trouver de nombreuses traboules ! Plein d’histoire et de charme, La Croix-Rousse est un incontournable de la ville pour votre week-end à Lyon. <br />\r\n<br />\r\nPour vous y rendre, il y a de nouveau l’option sportive et l’option économie d’énergie. Vous pouvez donc prendre le métro jusqu’à la station Hénon ou suivre notre itinéraire à pied pour découvrir de belles choses:<br />\r\n<br />\r\nÀ 12 minutes à pied au Nord-Ouest de la place des Terreaux vous pourrez admirer les escaliers colorés de Lyon au n°2 de la rue Prunelle<br />\r\nEn haut des marches, prenez à droite pour traverser le joli jardin des plantes<br />\r\nEnsuite vous allez attaquer la montée jusqu’à Croix-Rousse en empruntant la montée de la Grande Côte.', '2025-01-21', 1, );
INSERT INTO `posts` (`id_article`, `titre`, `contenu`, `date_publication`, `id_user`, `img`) VALUES
(22, 'Que faire à Lyon le temps d’un week-end ?', '                                            Depuis des mois, vous êtes très nombreux à nous demander cet article, il est enfin là ! Pour ceux qui ne le savent pas, nous résidons à Lyon même si notre présence se fait très rare. Nous allons donc vous aider au mieux à prévoir votre week-end à Lyon, ville inscrite au patrimoine mondial de l’Unesco. Ce guide sera mis à jour régulièrement en fonction de vos demandes spécifiques et de nos découvertes : incontournables à Lyon, restaurants, bars, hôtels, bons plans…<br />\r\n<br />\r\nTout d’abord, sachez que Lyon est connue et reconnue comme la capitale mondiale de la gastronomie. Nous ne sommes pas particulièrement fans des spécialités lyonnaises (quenelles, grattons, cardons, bugnes, Saint Marcelin, cervelle de Canut, foie de veau, tripes…). Cependant, il est vrai que nous mangeons (et buvons très bien ???? ) ici. Une ville de bons vivants quoi !<br />\r\n<br />\r\nPour vous rendre à Lyon, n’hésitez pas à regarder les différentes alternatives sur le site d’Omio.                                    ', '2025-01-22', 2, );
INSERT INTO `posts` (`id_article`, `titre`, `contenu`, `date_publication`, `id_user`, `img`) VALUES
(26, 'CSS Gradient', 'CSS Gradient is a designstripe project that lets you create free gradient backgrounds for your website. Besides being a css gradient generator, the site is also chock-full of colorful content about gradients from technical articles to real life gradient examples like Stripe and Instagram.<br />\r\n<br />\r\nWhy we made this?<br />\r\nSee gradients were super played out back in the early web days, but now they’re so ubiquitous that you’d be remiss not to drop them in your site, interface, or next hair dye job.<br />\r\n<br />\r\nAlso, I&#039;m part of a group of makers with a mission to build a better internet, one digital project at a time. One of our recent project launches is Cool Backgrounds another free design tool to generate background wallpaper for websites, blogs and phones.', '2025-01-23', 2, );
INSERT INTO `posts` (`id_article`, `titre`, `contenu`, `date_publication`, `id_user`, `img`) VALUES
(31, 'Les Momies', 'Au début du 19e siècle, l&#039;égyptologie, nouvelle discipline archéologique, a séduit un public large désireux de percer les mystères des pyramides et des momies. En 1869, la nouvelle de Louisa May Alcott, Lost in a Pyramid, or the Mummy&#039;s Curse (Perdus dans la Pyramide, ou la malédiction de la Momie), raconte l&#039;histoire d&#039;un archéologue maudit pour avoir détruit la momie d&#039;une jeune fille. « Je me demande parfois si je ne suis pas moi aussi maudit. Je suis quelque peu superstitieux et cette petite momie continue de hanter mes rêves, » faisait-elle dire à l&#039;assistant de l&#039;archéologue. <br />\r\n<br />\r\nDepuis, les momies hantent la culture populaire. Au moment où Howard Carter découvre le tombeau de Toutankhamon en 1922, l&#039;idée de la « malédiction de la momie » avait fait son chemin et avait été représentée dans les premières œuvres cinématographiques. Les momies ont envahi Hollywood en 1932 avec le film d&#039;horreur américain réalisé par Karl Freund, La Momie, avec Boris Karloff dans le rôle principal. Les momies reviennent depuis régulièrement terrifier les spectateurs des salles obscures, en créatures vengeresses retenues prisonnières entre la vie et la mort.', '2025-01-24', 4, );
INSERT INTO `posts` (`id_article`, `titre`, `contenu`, `date_publication`, `id_user`, `img`) VALUES
(33, 'BALADE DANS LE JARDIN IMPÉRIAL', 'Au nord du complexe palatial se trouve un jardin décoratif de bambous, de cyprès et de pins qu’émaillent des édifices tels que de petits pavillons. Le Jardin impérial fut construit au 15e siècle lors du règne de Yongle pour que le souverain suprême et son épouse officielle s’y divertissent. Conçu comme un espace paisible permettant de se rapprocher de la nature, le jardin fut par la suite agrandi et finit par couvrir près de quatre hectares. Il s’agit de l’un des quatre jardins du complexe et ses coins accueillent quatre pavillons qui représentent les quatre saisons.<br />\r\n<br />\r\nL’un d’eux, le pavillon des Dix-Mille Printemps est dédié au printemps. Sa base carrée représente la terre, tandis que son toit arrondi est le ciel orné de dragons et de phénix. Au milieu de cet environnement tranquille se tient le pavillon de la Paix impériale, un temple taoïste où les empereurs Ming pratiquaient l’alchimie et la divination. Le pavillon principal était dédié à Xuanwu (ou Zhenwu en version occidentale), puissant dieu de la guerre taoïste associé au Nord et à l’eau. Ce pavillon est le seul temple taoïste situé sur l’axe principal de la Cité interdite.<br />\r\n<br />\r\nLe Jardin impérial abrite un autre édifice remarquable, le Kiosque de la neige cramoisie, qui tire son nom des pommiers sauvages en fleurs qui poussaient là autrefois ; en tombant, leurs pétales évoquaient, dit-on, des flocons de neige rougeâtres (de nos jours, des seringats de Pékin [Philadelphus pekinesis] y sont plantés). Deux empereurs Qing en particulier, Kangxi (r. 1661-1722) et Qianlong (r. 1735-1796) appréciaient tant la beauté de la pergola qu’ils la considéraient comme leur endroit favori pour composer des poèmes.', '2025-01-24', 4, );
INSERT INTO `posts` (`id_article`, `titre`, `contenu`, `date_publication`, `id_user`, `img`) VALUES
(34, 'Néfertiti : portrait de reine', '                        Néfertiti, grande femme royale d’Amenothep IV (mieux connu sous le nom d’Akhenaton, qu’il a adopté plus tard dans sa vie), est une des figures les plus mystérieuses de l’Histoire et une de celles ayant le plus fait l’objet de louanges. Une multitude de passages dithyrambiques s’attardent sur son éclat, comme celui-ci, inscrit sur une stèle d’Amarna : « Éminence parmi les éminences de la noblesse, immense en son palais, d’allure sublime, belle à la double plume, maîtresse de joie unie à la grâce, dont on se réjouit d’entendre la voix, grande épouse du roi, sa bien-aimée, grande maîtresse des deux terres, Neferneferuaten, Néfertiti, immortelle pour l’éternité ! »<br />\r\n<br />\r\nSous le règne de son époux, l’Égypte se métamorphose : on remplace le polythéisme institué par une déité unique (le disque solaire Aton), et on déplace la capitale égyptienne vers Akhetaten, ville créée de toutes pièces dont le nom signifie « horizon du dieu Aton ». Mais la révolution d’Akhenaton est éphémère. Après son règne, l’Égypte se réapproprie son ancienne foi. Ses successeurs font tout pour effacer son nom et son héritage. On abandonne sa capitale. Les œuvres à son effigie et à son nom sont mutilées ainsi que celles représentant sa famille et Néfertiti. Leur legs restera enfoui durant des millénaires.                    ', '2025-01-24', 2, );
INSERT INTO `posts` (`id_article`, `titre`, `contenu`, `date_publication`, `id_user`, `img`) VALUES
(36, 'ISSIGEAC Dordogne, Nouvelle-Aquitaine', 'Dans ce village de pierres dorées, au cœur de la Dordogne, le marché du dimanche matin est l&#039;occasion de faire le plein de petits délices. Des producteurs de toutes sortes de produits locaux bordent les ruelles étroites et sinueuses, surplombées par des maisons à colombages. Le canard est la spécialité de la Dordogne, vous trouverez donc des bocaux de confit de canard et de pâté ainsi que, si la saison s’y prête, des fraises, des asperges et des truffes. Vous pouvez également acheter du vin directement aux producteurs et du pain cuit sur place dans un four à pain mobile. <br />\r\n<br />\r\nOù manger : L’Atelier est un restaurant charmant où les plats classiques sont remis au goût du jour. <br />\r\n<br />\r\nOù dormir : Concoctez un festin dans l’une des propriétés indépendantes Le Mas (pour deux personnes, minimum 100 euros par nuit, quatre nuits minimum) ou Le Mazet (jusqu’à dix personnes, 550 euros par nuit, six nuits minimum) à Sainte-Croix, près d’Issigeac. ', '2025-01-24', 2, );
INSERT INTO `posts` (`id_article`, `titre`, `contenu`, `date_publication`, `id_user`, `img`) VALUES
(37, 'POUR VIVRE UNE AVENTURE  Hiva Oa, Polynésie française', 'Sur Hiva Oa, l’une des îles de l’archipel reculé des Marquises, inscrit au patrimoine mondial de l’UNESCO en 2024, les pics volcaniques dentelés rencontrent les plages de sable noir et les gardénias en fleur. Dans le sud de l’île, à Atouna, dégustez du poisson cru frais face à la mer avant de prendre de la hauteur pour vous rendre sur les tombes du peintre et sculpteur Paul Gauguin et du chanteur Jacques Brel, qui ont tous deux vécu dans ce joli village jusqu&#039;à leur mort. Prenez ensuite la direction du nord, plus escarpé. Dans l’enclave montagneuse d’Upeke, vous pourrez admirer les sculptures sacrées en pierre, appelées tikis. Là-bas, seul le bruit des fruits à pain et des noix de coco se décrochant de leur arbre vient briser le silence.', '2025-01-24', 2, );
INSERT INTO `posts` (`id_article`, `titre`, `contenu`, `date_publication`, `id_user`, `img`) VALUES
(38, 'PARC NATIONAL DE REDWOODS - CALIFORNIE LA FORÊT DE LA LUNE ENDOR, STAR WARS ÉPISODE VI', '                        Partez pour une randonnée dans le parc national de Rewood, à la recherche d&#039;un Ewok se balançant dans les arbres. Le parcours Damnation Creek du parc mène les randonneurs à travers la forêt composée d&#039;arbres immenses et d&#039;une végétation luxuriante. Ces géants transporteront n&#039;importe quel fan sur la lune d&#039;Endor. Ce parc national est proche de la frontière séparant l’Oregon de la Californie, à 7 heures de voiture de San Francesc                    ', '2025-01-24', 2, );

